import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="w-full border-b-[1px] 	 border-green-400 h-[100px]  text-2xl flex justify-center items-center">
        <h1 className="text-2xl font-medium">News Portal</h1>
      </header>

      <div>
        <h1>Sign up</h1>
      </div>
    </div>
  );
}

export default App;
